@AMResidencesMiami Innovation, beauty and exclusivity shape every detail of the Signature Collection at the Aston Martin Residences. Floor to ceiling windows frame panoramic views from the tallest residential development south of New York. With perfect proportions, authentic luxury materials and exceptional craftsmanship throughout,  the exquisite penthouses at the Aston Martin Residences Miami are the epitome of style and elegance. The penthouses located from floors 56 to 62 offer the ultimate ocean and river views.
 
