@Kollosche_ offering this modern Gold Coast home set to be built later this year. A statement of minimalistic, modern design beckons metres from Nobby's Beach with these two brand new luxury villas due for completion late 2021. Clean lined and industrial in their style, polished and raw concrete finishes combine with sleek stone and the warmth of timber to create interiors that will command your instant attention.

Set out over three levels, the middle floor hosts a contemporary, open plan living, dining and kitchen area which seamlessly connects to a terrace and the possibility to create another guest suite or media room to the rear, while three bedrooms and two bathrooms await on the top floor. These include a generously sized master suite sanctuary tucked beneath a timber ceiling, spoiling you with architectural finishes, a walk-in robe and ensuite. A potential fourth bedroom is nestled on the ground floor, with access to a third bathroom, or it can be used as an additional family room with access to the plunge pool. You'll also benefit from an enviable lifestyle - one block back from the sand and sea, start your day with a beach walk and swim, catch up with friends over an artisan coffee or enjoy an evening meal or drink at a choice of many popular eateries.

